import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import { Typography, Container } from "@material-ui/core";
import Design from "../images/web-design.png";
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary
  }
}));

export default function Code() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Container maxWidth="lg">
        <Typography
          component="div"
          style={{
            backgroundColor: "white",
            height: "100vh",
            margin: "-224px 0px 0px",
            borderRadius: "25px"
          }}
        >
          <Grid container spacing={3}>
            <Grid item xs>
              <Typography variant="h6">Design</Typography>
              <Typography variant="subtitle1">
                Things I enjoy coloring:
              </Typography>
              <Typography>UX, UI, Mobile, Logos</Typography>
              <Typography>Tools:</Typography>
              <Typography>
                {" "}
                <ul style={{ listStyletype: "none " }}>
                  <li>paper</li>
                  <li>figma</li>

                  <li>adobe</li>

                  <li>photoshop</li>
                </ul>{" "}
              </Typography>
            </Grid>
            <Grid item xs>
              <Paper className={classes.paper}>Code</Paper>
            </Grid>
            <Grid item xs>
              <Paper className={classes.paper}>Buisness</Paper>
            </Grid>
          </Grid>
        </Typography>
      </Container>
    </div>
  );
}
